import React from "react";
import "./style.css";

function Jumbotron() {
  return (
    <div className="jumbotron text-center">
      <h1>React Best Buy</h1>
      <a target="_blank" rel="noopener noreferrer" href="https://bestbuyapis.github.io/api-documentation/">
        Powered by Best Buy API
      </a>
    </div>
  );
}

export default Jumbotron;
